export function getPrices(origin, destination, plan, time) {
  if (plan === "FaleMais30") {
    plan = 30;
  } else if (plan === "FaleMais60") {
    plan = 60;
  } else if (plan === "FaleMais120") {
    plan = 120;
  }

  let x;
  if (plan - time > 0) {
    x = plan - time;
  } else x = 0;

  if (origin === "011" && destination === "016") {
    return {
      withoutPlan: time * 1.9,
      withPlan: x * (1.9 * 1.1)
    };
  } else if (origin === "011" && destination === "017") {
    return {
      withoutPlan: time * 1.7,
      withPlan: x * (1.7 * 1.1)
    };
  } else if (origin === "011" && destination === "018") {
    return {
      withoutPlan: time * 0.9,
      withPlan: x * (0.9 * 1.1)
    };
  } else if (origin === "016" && destination === "011") {
    return {
      withoutPlan: time * 2.9,
      withPlan: x * (2.9 * 1.1)
    };
  } else if (origin === "017" && destination === "011") {
    return {
      withoutPlan: time * 2.7,
      withPlan: x * (2.7 * 1.1)
    };
  } else if (origin === "018" && destination === "011") {
    return {
      withoutPlan: time * 1.9,
      withPlan: x * (1.9 * 1.1)
    };
  }
}
